import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import './Footer.css';
import { FaWhatsapp, FaTelegramPlane, FaInstagram, FaVk, FaYoutube } from 'react-icons/fa';

const Footer = () => {
  return (
    <footer className="footer">
      <Container>
        <Row className="footer-top">
          <Col xs={12} md={3} className="footer-column">
            <h5>МЕБЕЛЬ НА ЗАКАЗ</h5>
            {/* Список категорий мебели на заказ */}
          </Col>
          <Col xs={12} md={3} className="footer-column">
            <h5>ИЗДЕЛИЯ В НАЛИЧИИ</h5>
            {/* Список категорий изделий в наличии */}
          </Col>
          <Col xs={12} md={3} className="footer-column">
            <h5>ИНФОРМАЦИЯ</h5>
            {/* Список информационных разделов */}
          </Col>
          <Col xs={12} md={3} className="footer-column">
            <h5>КОНТАКТЫ</h5>
            {/* Список контактов и соцсетей */}
          </Col>
        </Row>
        <Row className="footer-bottom">
          <Col xs={12} md={6} className="footer-column">
            <p>Компания «Breathoftime», 2024</p>
            <p>info@breathoftime.ru</p>
            <p>+7 (495) 798-93-94</p>
            {/* Социальные иконки */}
            <div className="social-icons">
              <a href="https://wa.me/74957989394"><FaWhatsapp /></a>
              <a href="https://t.me/username"><FaTelegramPlane /></a>
              <a href="https://instagram.com/username"><FaInstagram /></a>
              <a href="https://vk.com/username"><FaVk /></a>
              <a href="https://youtube.com/channel/channelid"><FaYoutube /></a>
            </div>
          </Col>
          <Col xs={12} md={6} className="footer-column">
            <p>Политика конфиденциальности</p>
            <p>Информация на сайте не является публичной офертой</p>
            <a href="https://podzolgov.ru/">Продвижение сайта: https://podzolgov.ru/</a>
          </Col>
        </Row>
      </Container>
    </footer>
  );
};

export default Footer;
